let $=el=>{
    return document.querySelectorAll(el);
}

let user=[
          "Instagram",
          "Youtube",
          "Facebook",
          "Snapchat",          
          "Pokemon Go",
          "Linkedin",
          "Whatsapp"          
];

let link=[
"data:image/png;base64,",
    "data:image/png;base64,",          
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,"                     
];

let info=[
    ["All these memes but, I still couldn't make you laugh","14:30",""],
    ["All these videos but, you decided to play me","13:51",""],
    ["All these comments and you still won't let me comment to your life","12:45",""],
    ["All these filters but, you still found me ugly","12:20",""],
    ["All these pokemon and you still didn't choose me","11:30",""],         
    ["All these requests but, we still don't have a connection","08:20",""],
    ["Typing...","07:45",""]
     
];
    
let message;
let tab=[".t1", ".t2", ".t3"];
onload=()=>{
    

    $(".n1 .list")[0].onmouseover=()=>{
        $(".n1 .list")[0].style.clipPath="circle(100%)";
        $(".n1 .list")[0].style.opacity="1";
    }
    $(".n1 .list")[0].onmouseleave=()=>{
        $(".n1 .list")[0].style.clipPath="circle(30% at 100% 0%)";
        $(".n1 .list")[0].style.opacity="0";
    }
    
    for(let i in tab){
        $(tab[i])[0].onclick=()=>{
            $(".dash")[0].style.transform=`translateX(${i*100}%)`;
        }
    }
    
    $(".fa-search")[0].onclick=()=>{
        $(".searchbox")[0].style.clipPath="circle(100% at 50% 50%)";
        $(".n2")[0].style.transform="translateY(-101%)";
        setTimeout(()=>{
        $(".n2")[0].style.position="absolute";
        },200)
    }
    $(".close")[0].onclick=()=>{
        $(".searchbox")[0].style.clipPath="circle(0% at 50% 50%)";
        $(".n2")[0].style.transform="translateY(0%)";
        $(".n2")[0].style.position="";
    }
    
    for(let i=0;i<user.length;i++){
        message=`<div class="chat">
                    <span class="avatar">
                        <img src="${link[i]}">
                    </span>
                    
                    <span class="container ${user[i]}">
                        <span class="info">
                            <span>${user[i]}</span>
                            <span>${info[i][1]}</span>
                        </span>
                        
                        <span class="message">
                        <span>${info[i][0]}</span>
                        <span>${info[i][2]}</span>
                        </span>
                    </span>
                </div>`;
                
            $("section")[0].innerHTML+=message;
    }
    $(".container")[user.length-1].style.border="none";
    $(".message")[user.length-1].style=`
    color:var(--green2);
    font-weight:bolder;
    `;
    
    setTimeout(()=>{
    main.style.display="block";
    loader.style.display="none";
    },3000)    
}